Our hearts ache for Riah Milton of Liberty Township, Ohio and Dominique “Rem’mie” Fells of Philadelphia, Pennsylvania and countless more. Black trans bodies often get ignored in the fight for equality regarding black bodies. it’s important we stand and solidarity with them and raise awareness. We need to create AND advocate for more safe spaces for all trans women - but especially BLACK TRANS WOMEN!
You cannot yell for a black lives matter if you exclude and acknowledge black trans lives!
This is all of our fight! more than ever, we need to unite!

